import Colors from "./Colors";

const CreatedAtPageStyle = {
    headerShown: true,
    headerTitle: "Filter By: Created At",
    headerTintColor: Colors.whiteColor,
    headerStyle: {
      backgroundColor: Colors.pageBgColor,
    }
}

export default CreatedAtPageStyle
